import './App.css';
import { Main_Page, Ad_banner } from './Routes/Main.js';
import Header from './Components/Header.js';
import { Routes, Route} from "react-router-dom";

// 주석 용도 내용 전달
// 기능 설명

function App() {
  return (
    <div className="App">

      {/* 메인페이지, 결과페이지 header Navbar */}

      <Routes>
        <Route path = "/" element = {
          <>
          <Header/>
          <Main_Page/>
          <Ad_banner/>
          </>
        }/>
        <Route path = "/searching" element = {
          <>
          <br/><br/>진행상황 페이지입니다.
          </>
        }/>
        <Route path = "/result" element = {
          <>
          <Header/>
          <Result/>
          </>
        }/>
        <Route path = "/login" element = {
          <>
          <br/><br/>로그인 페이지입니다.
          </>
        }/>
        <Route path = "/register" element = {
          <>
          <br/><br/>회원가입 페이지입니다.
          </>
        }/>
        <Route path = "/findid" element = {
          <>
          <br/><br/>아이디 찾기 페이지입니다.
          </>
        }/>
        <Route path = "/findpw" element = {
          <>
          <br/><br/>비밀번호 찾기 페이지입니다.
          </>
        }/>
        <Route path = "*" element = {
          <div> 404 Error : 없는 페이지 입니다.</div>
        }/>
      </Routes>

    </div>
  );
}

export default App;
